import React from "react";
import styled from "styled-components";

interface DefaultData {
  id: number;
  username: string;
  subject: string;
  content: string;
  ordernumber: number;
}

function Main() {
  const DEFAULT_DATA: DefaultData[] = [
    {
      id: 1,
      username: "janghyun1",
      subject: "First Title",
      content: "hi, my name i janghyun1.",
      ordernumber: 1,
    },
    {
      id: 2,
      username: "janghyun2",
      subject: "Second Title",
      content: "hi, my name i janghyun2.",
      ordernumber: 1,
    },
    {
      id: 3,
      username: "janghyun3",
      subject: "Third Title",
      content: "hi, my name i janghyun3.",
      ordernumber: 1,
    },
  ];

  const Wrap = styled.section`
    display: flex;
    justy
    width: 1400px;
    margin: 0 auto;
    padding: 40px;
  `;

  const Section = styled.section`
    margin: 20px;
    justify-content: space-between;
  `;

  const Title = styled.h1`
    font-size: 31px;
    font-weight: bold;
  `;

  const List = styled.ul`
    color: red;
  `;

  const Card = styled.li`
    color: red;
  `;

  return (
    <Wrap>
      <Section>
        <Title>To Do</Title>
        <List>
          {DEFAULT_DATA.map((data) => (
            <Card key={data.id}>
              {data.id}, {data.subject}
            </Card>
          ))}
        </List>
      </Section>
      <Section>
        <Title>Doing</Title>
        <List>
          {DEFAULT_DATA.map((data) => (
            <Card key={data.id}>
              {data.id}, {data.subject}
            </Card>
          ))}
        </List>
      </Section>
      <Section>
        <Title>Done</Title>
        <List>
          {DEFAULT_DATA.map((data) => (
            <Card key={data.id}>
              {data.id}, {data.subject}
            </Card>
          ))}
        </List>
      </Section>
    </Wrap>
  );
}

export default Main;
